// import About from './about';
// import Contact from './contact';
import Link from 'next/link'
function Home(){
    return <div>

        <h1>Hello world</h1>
        <Link href="/about">
            <a>About</a>
        </Link>
        <br/>
        <Link href="/contact">
            <a>Contact</a>
        </Link>
        </div>
}

export default Home;
